import Provider from "./Context/Provider";
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Login from "./Pages/Login";


function App() {
  return (
    <BrowserRouter>
      <Provider>
        <Switch>
          <Route path="/" component={ Login } exact />
        </Switch>
      </Provider>
    </BrowserRouter>
  );
}

export default App;
